import React from 'react';
import ReactDOM from 'react-dom';

const ulStyle = {
    color: 'blue',
    fontWeight: 'bold',
    fontSize: '20px',
}
function MyUl() {
    return (
        <ul>
             <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
            <li>5</li>
        </ul>
    )
}

ReactDOM.render(<MyUl />, document.getElementById('root'));
